INSERT INTO `wp_options` VALUES (1963,'external_updates-events-calendar-pro','O:8:\"stdClass\":3:{s:9:\"lastCheck\";i:1581437116;s:14:\"checkedVersion\";s:6:\"4.4.13\";s:6:\"update\";O:19:\"Tribe__PUE__Utility\":14:{s:2:\"id\";i:0;s:6:\"plugin\";N;s:4:\"slug\";N;s:7:\"version\";s:7:\"5.0.0.2\";s:8:\"homepage\";N;s:12:\"download_url\";N;s:8:\"sections\";O:8:\"stdClass\":1:{s:9:\"changelog\";s:449:\"<p>= [5.0.0.2] 2020-02-05 =</p>\r\n\r\n<ul>\r\n<li>Fix - Recurrent Events single page properly loads without a 404. [ECP-334]</li>\r\n<li>Fix - Non-Extension related fatal errors are now solved when doing a batch update of plugins [ECP-334]</li>\r\n<li>Fix - Fix redirection of post category and tag to the default event list on mobile. [TEC-3226]</li>\r\n<li>Fix - New views mobile breakpoints interactions with Caching plugins resolved. [TEC-3221]</li>\r\n</ul>\";}s:14:\"upgrade_notice\";N;s:13:\"custom_update\";N;s:11:\"api_expired\";b:1;s:11:\"api_invalid\";b:1;s:19:\"api_invalid_message\";s:331:\"<p>You are using %plugin_name% but your license key is expired. Visit <a href=\"https://theeventscalendar.com/license-keys/?utm_medium=pue&utm_campaign=in-app&utm_content=expired\">the Events Calendar website</a> to renew your license. You\'ll need to renew your license in order to have access to updates, downloads, and support.</p>\";s:26:\"api_inline_invalid_message\";s:387:\"<p>There is a new version of %plugin_name% available but your license key is expired. <a href=\"https://theeventscalendar.com/license-keys/?utm_medium=pue&utm_campaign=in-app&utm_content=expired-api-key\">Visit The Events Calendar website</a> to renew your license and have access to updates, downloads, and support. Learn what\'s new in the latest release of %plugin_name%. %changelog%</p>\";s:13:\"license_error\";s:582:\"<p>There is a new version of The Events Calendar PRO available but your license key is expired. <a href=\"https://theeventscalendar.com/license-keys/?utm_medium=pue&amp;utm_campaign=in-app&