;s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://theeventscalendar.com/the-events-calendar-5-0-frequently-asked-questions/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 11 Feb 2020 15:05:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Articles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1997930\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:628:\"<p>We recently shipped version 5.0 of  The Events Calendar and Events Calendar Pro. These new versions feature calendar views that have been redesigned from the ground-up, including the premium views available in Events Calendar Pro. This is a big change, so we&#8217;ve made the upgrade to views opt-in only. This means, at this time you&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/the-events-calendar-5-0-frequently-asked-questions/\">The Events Calendar 5.0: Frequently Asked Questions</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Geoff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6599:\"<p>We recently shipped version 5.0 of  The Events Calendar and Events Calendar Pro. These new versions feature calendar views that have been redesigned from the ground-up, including the premium views available in Events Calendar Pro.</p>\n<p>This is a big change, so we&#8217;ve made the upgrade to views <strong>opt-in only</strong>. This means, at this time you can safely update your plugin and won&#8217;t be forced to use the updated calendar design.</p>\n<p>Any time there’s a major change like this, we try our best to make everyone aware of what’s coming. If you haven’t seen the updates, you can <a href=\"https://theeventscalendar.com/getting-started-with-the-new-calendar-views/\">read up on what’s new</a> and how to upgrade to the new views:</p>\n<ul>\n<li style=\"font-weight: 400;\"><a href=\"https://theeventscalendar.com/the-events-calendar-5-0-0/\">The Events Calendar 5 Release Notes</a></li>\n<li style=\"font-weight: 400;\"><a href=\"https://theeventscalendar.com/events-calendar-pro-5-0-0/\">Events Calendar Pro 5 Release Notes</a></li>\n<li style=\"font-weight: 400;\"><a href=\"https://theeventscalendar.com/filter-bar-4-9-0/\">Filter Bar 4.9 Release Notes</a></li>\n</ul>\n<p>In addition to the updates, we’ve been getting great questions from customers about what happens after they <a href=\"https://theeventscalendar.com/knowledgebase/k/enabling-updated-calendar-views/\">opt in to the new designs</a>. We thought we’d share them with you here along with our answers.</p>\n<h2>What happens to my customizations?</h2>\n<p>They’re still in place! You won’t see them, however, because the re-designed views rely on an entirely new set of templates. If your calendar relies on a bunch of customizations and the updated views aren’t fully compatible, you can <a href=\"https://theeventscalendar.com/knowledgebase/k/enabling-updated-calendar-views/#reverting\">opt-out and revert to the previous design</a>, or translate your customizations to the new template override structure.</p>\n<h2>Why am I getting a &#8220;Page Not Found&#8221; error when clicking my calendar links?</h2>\n<p>The short answer is that we put some new redirects in place for the new views in <a href=\"https://theeventscalendar.com/events-calendar-pro-5-0-0-2/\">Events Calendar Pro 5.0.0.2</a>. If you’re getting a Page Not Found (404) error, head over to Settings → Permalinks from the WordPress dashboard and try simply clicking the “Save Changes” button &#8212; yes, even though you’re not making any changes. This will “flush” the permalinks (by triggering `<a href=\"https://developer.wordpress.org/reference/functions/flush_rewrite_rules/\">flush_rewrite_rules</a>`) on your site to update the URL rewrite rules.</p>\n<p>That should do the trick but, if it doesn’t, we have a <a href=\"https://theeventscalendar.com/knowledgebase/k/fixing-http-404-errors/\">couple of other methods</a> to try next.</p>\n<h2>How long will you support the legacy view styles?</h2>\n<p>We’re currently planning to maintain support for the previous designs for 9-12 months (until Fall 2020 or so). We’re doing that to give everyone plenty of time to prepare and transition their sites. That said, any new work we do on the calendar will be focused around the updated designs.</p>\n<p>You’re totally free to keep using the previous views, even when updating to version 5. Go to Events → Settings → Display and uncheck the “Enable updated designs for all calendar views” option.</p>\n<h2>How do I switch back to the legacy view styles?</h2>\n<p>You can switch back to the previous calendar designs anytime! Make your way over to Events → Settings → Display and uncheck the “Enable updated designs for all calendar views” option.</p>\n<p>And, of course, you can always re-activate the new calendar designs using the same setting.</p>\n<h2>Can I still use the WordPress Customizer to make styling changes?</h2>\n<p>If you were using the WordPress Customizer previously to tweak the legacy views, those settings will not impact the views once you’ve updated to the new designs. While there are a few things you can adjust in the new designs with the Customizer, keep an eye out for more options for the updated views in future updates!</p>\n<h2>I was using one of your calendar extensions and it stopped working. What should I do?</h2>\n<p><a href=\"https://theeventscalendar.com/knowledgebase/k/pre-sales-questions/\">Please let us know!</a> Many of our extensions were made to work with the legacy views code, so they won’t work on calendars using the updated styles. We plan to update or replace our top extensions to work with the updated view designs, so it’s helpful for customers to report which ones are not compatible.</p>\n<p>While we can’t guarantee that we will be able to update every extension, we at least want to know which ones need some care.</p>\n<h2>How can I customize the new views?</h2>\n<p>We&#8217;re working on new versions of our customization resources that will provide step-by-step instructions and examples of how to modify the look and functionality of the calendar. It&#8217;s largely going to follow the same pattern that The Events Calendar has always used, which involves overriding view templates and styles with custom files in your theme. The difference will be where those overrides specifically go.</p>\n<p>In the meantime, we&#8217;ve created a few new resources for customizing the new views:</p>\n<ul>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/k/using-filters-and-actions/\">Using Filters and Actions</a></li>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/k/customizing-mobile-css/\">Customizing Mobile Styles</a></li>\n<li><a href=\"https://theeventscalendar.com/knowledgebase/k/add-external-functionality-into-events-views/\">Display Custom Fields in the Month View Tooltip</a></li>\n<li style=\"font-weight: 400;\"><a href=\"https://theeventscalendar.com/knowledgebase/k/how-to-customize-templates-and-css-in-a-view/\">Customizing Photo View</a></li>\n<li style=\"font-weight: 400;\"><a href=\"https://theeventscalendar.com/knowledgebase/k/show-events-by-custom-field/\">Show Events Based on Custom Fields</a></li>\n</ul>\n<hr />\n<p>Have questions that are covered here? Let us know by reaching out to <a href=\"https://support.theeventscalendar.com\">our support team</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/the-events-calendar-5-0-frequently-asked-questions/\">The Events Calendar 5.0: Frequently Asked Questions</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"Event Tickets 4.11.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://theeventscalendar.com/event-tickets-4-11-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Feb 2020 22:11:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1996010\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:597:\"<p>Hey folks! Today&#8217;s release of Event Tickets 4.11.3 focuses on several fixes and tweaks. For example, we&#8217;ve added support for ticket discounted pricing and have updated our Attendees List feature, along with other goodies. This is a minor release that should be smooth sailing when updating. That said, it’s always a good idea to backup your site and&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/event-tickets-4-11-3/\">Event Tickets 4.11.3</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Courtney\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8736:\"<p>Hey folks! Today&#8217;s release of Event Tickets 4.11.3 focuses on several fixes and tweaks. For example, we&#8217;ve added support for <a href=\"https://theeventscalendar.com/knowledgebase/k/tickets-and-sales-pricing/\">ticket discounted pricing</a> and have updated our <a href=\"https://theeventscalendar.com/knowledgebase/k/public-attendee-list/\">Attendees List</a> feature, along with other goodies.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it’s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<p>Let&#8217;s get a look at that changelog:</p>\n<hr />\n<ul>\n<li><strong>Feature</strong> &#8211; We&#8217;ve added support to show <a href=\"https://theeventscalendar.com/knowledgebase/k/tickets-and-sales-pricing/\">discounted pricing for tickets</a>. In addition to setting a &#8220;sale&#8221; price, the calendar will show the original price on the ticket block if a ticket is on sale. You can turn this off via the <a href=\"https://docs.theeventscalendar.com/reference/functions/tribe_tickets_show_original_price_on_sale/\"><samp>tribe_tickets_show_original_price_on_sale</samp></a> filter.</li>\n<li><strong>Fix</strong> &#8211; Each ticket that you create can have a <a href=\"https://theeventscalendar.com/knowledgebase/k/making-tickets/#global-stock\">header image</a>. However, they weren&#8217;t working on non-events pages. It works again as expected.</li>\n<li><strong>Fix</strong> &#8211; Our attendees template forgot to stop the code. As a result, it would break HTML and users would see some weird characters that weren’t meant to be on the page. We closed the open <samp>div</samp> in <samp>blocks/attendees.php</samp>.</li>\n<li><strong>Fix</strong> &#8211; Since last major refresh to Event Tickets, some themes have experienced conflicts. To solve that, we corrected the broken JavaScript for themes that change the base post CSS classes.</li>\n<li><strong>Fix</strong> &#8211; In the Classic editor, multiple RSVPs can appear on a single event. If the last RSVP was sold out, no other remaining RSVPs could be &#8220;purchased.&#8221; We fixed the logic so selling out of one RSVP doesn&#8217;t prevent &#8220;purchasing&#8221; another.</li>\n<li><strong>Fix</strong> &#8211; The ticket prices and totals were not displayed correctly for currencies/languages that use an alternate comma/decimal point syntax. The price formatting method now prevents incorrect display when a comma is used as the decimal separator.</li>\n<li><strong>Fix</strong> &#8211; When using the password protection option in the post Visibility setting of the Classic editor, the tickets form still displayed on the page, even without having entered the post password. We&#8217;ve disabled RSVP and Tickets blocks from displaying when password protection is enabled on posts or pages.</li>\n<li><strong>Fix</strong> &#8211; We&#8217;re ensuring that <a href=\"https://theeventscalendar.com/knowledgebase/k/making-tickets/#global-stock\">Who&#8217;s Attending</a> images display horizontally on the front end for the WordPress Twenty Nineteen and Twenty Twenty themes.</li>\n<li><strong>Fix</strong> &#8211; We updated JavaScript to remove console errors in Internet Explorer 11.</li>\n<li><strong>Fix</strong> &#8211; Tribe Commerce Tickets were unable to be purchased when the Classic Editor plugin was enabled. We fixed this by loading JavaScript assets along with Ticket Block when using the Classic Editor plugin.</li>\n<li><strong>Fix</strong> &#8211; When using a custom page for Attendee Registration, WooCommerce cart links were not respecting the settings in Events &rarr; Settings &rarr; Tickets &rarr; Attendee Registration Page. We&#8217;re overriding the checkout link in WooCommerce Mini-Cart widget so it uses the custom page for attendee registration if it is configured.</li>\n<li><strong>Fix</strong> &#8211; We&#8217;ve removed an inaccurate display of the &#8220;You don&#8217;t have tickets for this event&#8221; notice on the event single.</li>\n<li><strong>Fix</strong> &#8211; The &#8220;RSVP Now!&#8221; button in the calendar List view correctly displays when events have RSVPs but no tickets and provides the correct anchor link to the ticket form on the event single.</li>\n<li><strong>Fix</strong> &#8211; The Tickets Block plus and minus quantity buttons are now set to <samp>type=&#8221;button&#8221;</samp> to avoid submitting the &#8220;Add to Cart&#8221; form in Internet Explorer 11 or when JavaScript is disabled. Similar changes for other non-submit buttons throughout.</li>\n<li><strong>Fix</strong> &#8211; Translating terms, like &#8220;RSVP&#8221; and &#8220;tickets,&#8221; is important. We&#8217;re providing an additional implementation of dynamic ticket text functions so that singular and plural versions of &#8220;ticket&#8221; change in more areas when filtered.</li>\n<li><strong>Fix</strong> &#8211; We should <em>not</em> set an end sale date automatically &mdash; particularly not the published date of the post. Instead, we are leaving it blank and you can set an end date.</li>\n<li><strong>Tweak</strong> &#8211; We noticed some capacity calculation issues on attendee and order reports. To improve that, we created a new function <a href=\"https://docs.theeventscalendar.com/reference/functions/tribe_get_event_capacity/\"><samp>tribe_get_event_capacity()</samp></a> for checking the capacity of an entire event.  <a href=\"https://docs.theeventscalendar.com/reference/functions/tribe_tickets_get_capacity/\"><samp>tribe_tickets_get_capacity()</samp></a> passes off to it as when given an event. Previously, <a href=\"https://docs.theeventscalendar.com/reference/functions/tribe_tickets_get_capacity/\"><samp>tribe_tickets_get_capacity()</samp></a> would return null if given an event.</li>\n<li><strong>Tweak</strong> &#8211; Refined logic for the &#8220;No results&#8221; notice on the &#8220;My Tickets&#8221; page to include if a user has a ticket, an RSVP, both, or neither.</li>\n<li><strong>Tweak</strong> &#8211; We removed duplicate scripts to prevent JavaScript conflicts between Tribe Commerce and WooCommerce.</li>\n<li><strong>Tweak</strong> &#8211; We&#8217;ve been working on our <a href=\"https://theeventscalendar.com/knowledgebase/k/public-attendee-list/\">Public Attendees information</a>. We changed the Attendee List opt-out checkbox to be checked by default, changed its wording, and centralized where we handle it in the codebase.</li>\n<li><strong>Tweak</strong> &#8211; Public Attendee information is very important for privacy concerns ,like GDPR and the California Privacy Act. We&#8217;ve added some code for future implementation around converting opt-outs to opt-ins. This is a work in progress.</li>\n<li><strong>Tweak</strong> &#8211; We adjusted styles to ensure our &#8220;Get Tickets&#8221; button styles are preserved.</li>\n<li><strong>Plugin Hooks</strong> – <a href=\"https://docs.theeventscalendar.com/reference/since/event.tickets4.11.3\">https://docs.theeventscalendar.com/reference/since/event.tickets4.11.3</a></li>\n<li><strong>Tweak</strong> &#8211; Updated plugin templates:\n<ul>\n<li>blocks/attendees</li>\n<li>blocks/attendees/description</li>\n<li>blocks/rsvp/form/error</li>\n<li>blocks/rsvp/form/opt-out</li>\n<li>blocks/rsvp/form/quantity-plus</li>\n<li>blocks/rsvp/form/submit-button</li>\n<li>blocks/rsvp/messages/success</li>\n<li>blocks/tickets</li>\n<li>blocks/tickets/extra-available</li>\n<li>blocks/tickets/extra-price</li>\n<li>blocks/tickets/extra</li>\n<li>blocks/tickets/footer-total</li>\n<li>blocks/tickets/item</li>\n<li>blocks/tickets/opt-out-hidden</li>\n<li>blocks/tickets/quantity-add</li>\n<li>blocks/tickets/quantity-remove</li>\n<li>blocks/tickets/registration/summary/title</li>\n<li>blocks/tickets/submit-button-modal</li>\n<li>blocks/tickets/submit-button</li>\n<li>modal/item-remove</li>\n<li>modal/item-total</li>\n<li>modal/registration-js</li>\n<li>registration-js/attendees/ticket</li>\n<li>tickets/email</li>\n<li>tickets/orders-pp-tickets</li>\n<li>tickets/orders-rsvp</li>\n<li>tickets/orders</li>\n<li>tickets/rsvp</li>\n<li>tickets/tpp</li>\n</ul>\n</li>\n<li><strong>Language</strong> &#8211; <kbd>7 new strings added, 187 updated, 7 fuzzied, and 6 obsoleted</kbd></li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/event-tickets-4-11-3/\">Event Tickets 4.11.3</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Community Events 4.6.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://theeventscalendar.com/community-events-4-6-7/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Feb 2020 19:33:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1996080\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:599:\"<p>Greetings! Community Events 4.6.7 is a small update correcting compatibility issues and settings for using the main calendar as the site homepage. This is a minor release that should be smooth sailing when updating. That said, it’s always a good idea to backup your site and test changes in a development environment before installing this on your live site,&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/community-events-4-6-7/\">Community Events 4.6.7</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Courtney\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1816:\"<p>Greetings! Community Events 4.6.7 is a small update correcting compatibility issues and settings for using the main calendar as the site homepage.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it’s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<hr />\n<p>On to the changelogs:</p>\n<ul>\n<li><strong>Fix</strong> &#8211; To resolve some compatibility issues, we updated the WP Router library to avoid fatal errors with PHP 7.3 when using custom rewrite routes for Community Events URLs.</li>\n<li><strong>Fix</strong> &#8211; If the site&#8217;s &#8220;Homepage&#8221; option is set to &#8220;Main Events Page,&#8221; the &#8220;Community URLs&#8221; section of admin settings now warns you if &#8220;pretty&#8221; permalinks are not enabled and then fixes missing slashes in the URLs.</li>\n<li><strong>Tweak</strong> &#8211; Changed plugin templates: <samp>community/modules/venue-fields</samp></li>\n<li><strong>Plugin Hooks</strong> &#8211; <a href=\"https://docs.theeventscalendar.com/reference/since/events.community4.6.7/\">https://docs.theeventscalendar.com/reference/since/events.community4.6.7/</a></li>\n<li><strong>Language</strong> &#8211; <kbd>1 new strings added, 162 updated, 0 fuzzied, and 9 obsoleted</kbd></li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/community-events-4-6-7/\">Community Events 4.6.7</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Event Tickets Plus 4.11.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://theeventscalendar.com/event-tickets-plus-4-11-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Feb 2020 19:33:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1996065\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:626:\"<p>Howdy!  Today&#8217;s release of Event Tickets Plus 4.11.2 brings support for ticket sales pricing for WooCommerce users, fixing the default end-date for ticket sales, and plenty more. This is a minor release that should be smooth sailing when updating. That said, it’s always a good idea to backup your site and test changes in a development environment before installing this&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/event-tickets-plus-4-11-2/\">Event Tickets Plus 4.11.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Courtney\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4867:\"<p>Howdy!  Today&#8217;s release of Event Tickets Plus 4.11.2 brings support for <a href=\"https://theeventscalendar.com/knowledgebase/k/tickets-and-sales-pricing/\">ticket sales pricing</a> for WooCommerce users, fixing the default end-date for ticket sales, and plenty more.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it’s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<hr />\n<p>On to the changelogs:</p>\n<ul>\n<li><strong>Feature</strong> &#8211; Translating terms, like &#8220;RSVP&#8221; and &#8220;tickets,&#8221; is important. We&#8217;re providing an additional implementation of dynamic ticket text functions so singular and plural versions of &#8220;ticket&#8221; change in more areas when filtered. We are implementing new functions from Event Tickets to easily rename ticket types and ensure consistent wording. Many translated strings will need updating. <a href=\"https://theeventscalendar.com/knowledgebase/k/how-to-override-plugin-language-files/\">Translated strings</a> will need updating. You can <a href=\"https://theeventscalendar.com/knowledgebase/k/translating-the-premium-plugins/\">contribue</a> or just <a href=\"https://theeventscalendar.com/knowledgebase/k/change-the-wording-of-any-bit-of-text-or-string/\">change a bit of wording</a>.</li>\n<li><strong>Fix</strong> &#8211; We&#8217;ve added support to show <a href=\"https://theeventscalendar.com/knowledgebase/k/tickets-and-sales-pricing/\">discount pricing for tickets</a>. In addition to setting a &#8220;sale&#8221; price for a ticket, the original price will display on the ticket block if a ticket is on sale. We are correcting checks to WooCommerce <samp>is_on_sale()</samp>, <samp>get_regular_price()</samp> and <samp>get_sale_price()</samp>.</li>\n<li><strong>Fix</strong> &#8211; We corrected text domain strings that did not match <samp>event-tickets-plus</samp>. These previously caused translation issues.</li>\n<li><strong>Fix</strong> &#8211; We should not automatically set an end sale date, particularly not the published date of the post. Instead, we are leaving it blank and you can set an end date. We&#8217;re ensuring that we are correctly checking <a href=\"https://docs.theeventscalendar.com/reference/classes/tribe__tickets__rest__v1__post_repository/get_ticket_end_date/\"><samp>ticket_end_date</samp></a> when saving the ticket start and end date from the ticket editor.</li>\n<li><strong>Fix</strong> &#8211; Some users found plugin conflicts after completing the attendee registration page and moving on to the WooCommerce checkout. We stopped adding the <samp>&amp;provider=tribe_wooticket</samp> query argument to WooCommerce Cart and Checkout URLs if there aren&#8217;t tickets in the cart.</li>\n<li><strong>Tweak</strong> &#8211; Now we enable a security code check during QR check-in by default. We&#8217;ve modified a filter to make this happen.</li>\n<li><strong>Tweak</strong> &#8211; As part of the work on translation issues, we cleaned up additional escaping in the <samp>woocommerce-metabox-capacity</samp> admin-view template and adjusted code formatting of some view templates.</li>\n<li><strong>Tweak</strong> &#8211; We removed duplicate scripts to prevent JavaScript conflicts between Tribe Commerce and WooCommerce.</li>\n<li><strong>Tweak</strong> &#8211; We&#8217;ve been working on our <a href=\"https://theeventscalendar.com/knowledgebase/k/public-attendee-list/\">Public Attendees information</a>. We added a note to the Public Attendees List opt-out checkbox in tickets admin (only for Classic editor).</li>\n<li><strong>Tweak</strong> &#8211; Removed filters:\n<ul>\n<li><samp>wootickets_email_message</samp></li>\n</ul>\n<li><strong>Tweak</strong> &#8211; Updated plugin templates:\n<ul>\n<li><samp>attendees-list</samp></li>\n<li><samp>tickets-plus/orders-edit-meta</samp></li>\n<li><samp>tickets-plus/orders-tickets</samp></li>\n</ul>\n</li>\n<li><strong>Plugin Hooks –<a href=\"https://docs.theeventscalendar.com/reference/since/event.tickets.plus4.11.2\"> </a></strong><a href=\"https://docs.theeventscalendar.com/reference/since/event.tickets.plus4.11.2\">https://docs.theeventscalendar.com/reference/since/event.tickets.plus4.11.2</a></li>\n<li><strong>Language</strong> &#8211; <kbd>50 new strings added, 68 updated, 29 fuzzied, and 43 obsoleted</kbd></li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/event-tickets-plus-4-11-2/\">Event Tickets Plus 4.11.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:51:\"\n		\n		\n				\n		\n				\n		\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Why You Should Add RSVP to Your Free Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://theeventscalendar.com/why-you-should-add-rsvp-to-your-free-events/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Feb 2020 20:58:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Articles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1996841\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:605:\"<p>A major perk of hosting free events: They’re slightly easier to manage than ticketed events.  Without any tickets to sell, you don’t need to set up an ecommerce platform or make decisions about how money changes hands. But even if you’re not selling tickets, it’s worth adding an RSVP to your free events.  Why bother?&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/why-you-should-add-rsvp-to-your-free-events/\">Why You Should Add RSVP to Your Free Events</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Lauren\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9083:\"<p><span style=\"font-weight: 400;\">A major perk of hosting free events: They’re slightly easier to manage than ticketed events. </span></p>\n<p><span style=\"font-weight: 400;\">Without any </span><a href=\"https://theeventscalendar.com/how-to-sell-event-tickets-on-wordpress/\"><span style=\"font-weight: 400;\">tickets to sell</span></a><span style=\"font-weight: 400;\">, you don’t need to set up an ecommerce platform or make decisions about how money changes hands. But even if you’re not selling tickets, it’s worth adding an RSVP to your free events. </span></p>\n<p><span style=\"font-weight: 400;\">Why bother? Fair question, but we promise, it’s worth it: By collecting RSVPs, you can estimate attendance numbers, gather valuable attendee information, improve your marketing efforts for future events, and more.</span></p>\n<p><span style=\"font-weight: 400;\">Plus, adding an RSVP to your events on WordPress is easy! Read on to learn more about how to make the most of your free events with RSVPs.</span></p>\n<h2><b>Do I </b><b><i>really</i></b><b> need to ask for RSVPs on free events?</b></h2>\n<p><span style=\"font-weight: 400;\">You probably wouldn’t send an invitation to a dinner party or a wedding without asking your guests to RSVP—so why would you skip this step for your events?</span></p>\n<p><span style=\"font-weight: 400;\">On the practical side, gathering RSVPs will help you estimate how many people will attend your event. This is especially important if your venue has limited space, or if you’re ordering snacks for a crowd. If you don’t plan for the right number of people, you could find yourself out of seats or hors d&#8217;oeuvres—not a good experience for your attendees.</span></p>\n<p><span style=\"font-weight: 400;\">Adding an RSVP can also help encourage attendees to actually show up for the event. By asking for a clear “yes” or “no,” attendees will be more likely to follow through. This simple tactic is one way you can </span><a href=\"https://theeventscalendar.com/4-ways-to-prevent-flakiness-from-event-attendees/\"><span style=\"font-weight: 400;\">stave off flakiness</span></a><span style=\"font-weight: 400;\"> and increase attendance at your next event.</span></p>\n<p><span style=\"font-weight: 400;\">Finally, collecting RSVPs is a marketing opportunity for event organizers and promoters. Gather attendees’ contact information through the RSVP form and then stay in touch with </span><a href=\"https://theeventscalendar.com/the-most-important-email-to-promote-your-event/\"><span style=\"font-weight: 400;\">event reminders</span></a><span style=\"font-weight: 400;\"> and announcements for future events.</span></p>\n<h2><b>How do I add an RSVP to my free events on WordPress?</b></h2>\n<p><span style=\"font-weight: 400;\">The easiest way to start collecting RSVPs is with the help of a plugin like </span><a href=\"https://theeventscalendar.com/product/wordpress-event-tickets/\"><span style=\"font-weight: 400;\">Event Tickets</span></a><span style=\"font-weight: 400;\">. It works  great with our flagship </span><a href=\"https://theeventscalendar.com/product/wordpress-events-calendar-pro/\"><span style=\"font-weight: 400;\">events calendar</span></a><span style=\"font-weight: 400;\"> plugin, but you can use it with any WordPress page, post, or even custom post type.</span></p>\n<p><span style=\"font-weight: 400;\">To get started, simply enable RSVP functionality under </span><i><span style=\"font-weight: 400;\">Events </span></i><i><span style=\"font-weight: 400;\">→</span></i><i><span style=\"font-weight: 400;\"> Settings </span></i><i><span style=\"font-weight: 400;\">→ </span></i><i><span style=\"font-weight: 400;\">Tickets </span></i><span style=\"font-weight: 400;\">from your WordPress dashboard. You’ll see options that allow you to enable tickets on any page and post type. And, yes, even though it says “tickets” it refers to both tickets and RSVPs.</span></p>\n<p><img class=\"aligncenter wp-image-1996843 size-large\" src=\"https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-665x454.png\" alt=\"\" width=\"665\" height=\"454\" srcset=\"https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-665x454.png 665w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-300x205.png 300w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-124x85.png 124w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-768x525.png 768w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-1536x1049.png 1536w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-430x294.png 430w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-645x441.png 645w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-1068x730.png 1068w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-460x314.png 460w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-600x410.png 600w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress-500x342.png 500w, https://s3.theeventscalendar.com/uploads/2020/02/rsvp-wordpress.png 1600w\" sizes=\"(max-width: 665px) 100vw, 665px\" /></p>\n<p><span style=\"font-weight: 400;\">Then, head to the event, page, or post where you’d like to add RSVPs, scroll down to </span><i><span style=\"font-weight: 400;\">Tickets meta box, </span></i><span style=\"font-weight: 400;\">and click on the </span><b>+ New RSVP </b><span style=\"font-weight: 400;\">button.</span></p>\n<p><img class=\"aligncenter wp-image-1996845 size-full\" src=\"https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button.png\" alt=\"\" width=\"614\" height=\"110\" srcset=\"https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button.png 614w, https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button-300x54.png 300w, https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button-140x25.png 140w, https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button-430x77.png 430w, https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button-460x82.png 460w, https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button-600x107.png 600w, https://s3.theeventscalendar.com/uploads/2020/02/add-rsvp-wordpress-button-500x90.png 500w\" sizes=\"(max-width: 614px) 100vw, 614px\" /></p>\n<p><span style=\"font-weight: 400;\">Now, you can customize your RSVP. Need to designate a maximum capacity for RSVPs? You can do that here. You can also decide whether to display how many “tickets” (or RSVPs) are remaining.</span></p>\n<p><span style=\"font-weight: 400;\">Expand the “Advanced” section to create a description of the RSVP, schedule when to activate the RSVP form, and set a limit on how many people can attend. This is a great way to keep control of your event.</span></p>\n<p><img class=\"aligncenter wp-image-1996844 size-large\" src=\"https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-665x433.png\" alt=\"\" width=\"665\" height=\"433\" srcset=\"https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-665x433.png 665w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-300x195.png 300w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-130x85.png 130w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-768x500.png 768w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-430x280.png 430w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-645x420.png 645w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-1068x696.png 1068w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-460x300.png 460w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-600x391.png 600w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal-500x326.png 500w, https://s3.theeventscalendar.com/uploads/2020/02/registration-modal.png 1274w\" sizes=\"(max-width: 665px) 100vw, 665px\" /></p>\n<p><span style=\"font-weight: 400;\">Oh, and that “Attendee Information” section? That’s a perk you get with </span><a href=\"https://theeventscalendar.com/product/wordpress-event-tickets-plus/\"><span style=\"font-weight: 400;\">Event Tickets Plus</span></a><span style=\"font-weight: 400;\">, which is an add-on to Event Tickets. By upgrading to Event Tickets Plus, you’ll unlock features like </span><a href=\"https://theeventscalendar.com/knowledgebase/k/collecting-attendee-information/\"><span style=\"font-weight: 400;\">custom fields</span></a><span style=\"font-weight: 400;\">, which allow you to collect additional information from your guests beyond name and email address. This extra feature is a huge time saver if you need to gather info such as T-shirt size, meal preference, allergies, or other details specific to your event.</span></p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/why-you-should-add-rsvp-to-your-free-events/\">Why You Should Add RSVP to Your Free Events</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Events Calendar Pro 5.0.0.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://theeventscalendar.com/events-calendar-pro-5-0-0-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Feb 2020 18:53:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1996668\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:568:\"<p>Howdy all! We&#8217;re releasing a quick update here that fixes issues with recurring events pages and 404 errors, as well as some fatal errors that were reported by customers. This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to backup your site and test changes&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/events-calendar-pro-5-0-0-2/\">Events Calendar Pro 5.0.0.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Jaime Marchwinski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1772:\"<p>Howdy all! We&#8217;re releasing a quick update here that fixes issues with recurring events pages and 404 errors, as well as some fatal errors that were reported by customers.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<hr />\n<p>Let&#8217;s get to the changelogs:</p>\n<ul>\n<li><strong>Fix</strong> &#8211; We resolved an issue that prevented the event single in a recurring series from properly loading without a 404. If you continue to experience this issue, go to Settings &gt; Permalinks and click the Save Changes button.</li>\n<li><strong>Fix</strong> &#8211;  Fatal errors that are not related to <a href=\"https://theeventscalendar.com/extensions\">extensions</a> are now solved when doing a batch update of plugins.</li>\n<li><strong>Fix</strong> &#8211; It was discovered that selecting a post category redirected users to the default calendar view instead of the currently selected view. We have fixed how post categories and tags are redirected.</li>\n<li><strong>Fix</strong> &#8211; We fixed an issue where the mobile breakpoint for the 5.0 redesigned views  was conflicting with caching plugins.</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/events-calendar-pro-5-0-0-2/\">Events Calendar Pro 5.0.0.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"The Events Calendar 5.0.0.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://theeventscalendar.com/the-events-calendar-5-0-0-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Feb 2020 18:49:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1996669\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:581:\"<p>Howdy all! We&#8217;re releasing a quick update that makes improvements on the datepicker functionality and the mobile breakpoints for the redesigned views that shipped in version 5.0. This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to backup your site and test changes in a&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/the-events-calendar-5-0-0-2/\">The Events Calendar 5.0.0.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Jaime Marchwinski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1457:\"<p>Howdy all! We&#8217;re releasing a quick update that makes improvements on the datepicker functionality and the mobile breakpoints for the redesigned views that shipped in version 5.0.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<hr />\n<p>Let&#8217;s get to the changelogs:</p>\n<ul>\n<li><strong>Fix</strong> &#8211; Users discovered that the event start and end dates would disappear from the event editor. The datepicker format now properly defaults to the correct value when Display Settings have not been saved.</li>\n<li><strong>Fix</strong> &#8211; We fixed an issue where the mobile breakpoint for the 5.0 redesigned views  was conflicting with caching plugins.</li>\n<li><strong>Fix</strong> &#8211; We&#8217;re preventing a fatal error in Context when the global query object is not set.</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/the-events-calendar-5-0-0-2/\">The Events Calendar 5.0.0.2</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Events Calendar Pro 5.0.0.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://theeventscalendar.com/events-calendar-pro-5-0-0-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 31 Jan 2020 20:13:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1992837\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:563:\"<p>Howdy all! We&#8217;re releasing a quick update for you that fixes an issue with multi-day events displaying on the correct days, as well as a plugin conflict that came up in the redesigned calendar views. This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/events-calendar-pro-5-0-0-1/\">Events Calendar Pro 5.0.0.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Jaime Marchwinski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1336:\"<p>Howdy all! We&#8217;re releasing a quick update for you that fixes an issue with multi-day events displaying on the correct days, as well as a plugin conflict that came up in the redesigned calendar views.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<hr />\n<p>Let&#8217;s get to the changelogs:</p>\n<ul>\n<li><strong>Fix</strong> &#8211; Events that span multiple days now appear on their correct dates.</li>\n<li><strong>Fix</strong> &#8211; We have fixed a number of parameters in the <samp>the_post</samp> action for the single event view in the redesigned calendar views. This created a plugin conflict with Woody Ad Snippets and is now everything works together nicely.</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/events-calendar-pro-5-0-0-1/\">Events Calendar Pro 5.0.0.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"The Events Calendar 5.0.0.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://theeventscalendar.com/the-events-calendar-5-0-0-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 31 Jan 2020 20:12:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1992834\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:595:\"<p>Howdy all! We&#8217;re releasing a quick update that resolves a few issues that customers reported with timezones, multi-day events, and the end-of-day cutoff setting. This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to backup your site and test changes in a development environment before&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/the-events-calendar-5-0-0-1/\">The Events Calendar 5.0.0.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Jaime Marchwinski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1805:\"<p>Howdy all! We&#8217;re releasing a quick update that resolves a few issues that customers reported with timezones, multi-day events, and the end-of-day cutoff setting.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<hr />\n<p>Let&#8217;s get to the changelogs:</p>\n<ul>\n<li><strong>Fix</strong> &#8211; We have resolved an issue that prevented events from displaying on the correct date when the site timezone settings were different form the calendar&#8217;s timezone settings.</li>\n<li><strong>Fix</strong> &#8211; We addressed an issue that prevented multi-day events from displaying on the correct days.</li>\n<li><strong>Fix</strong> &#8211; The end-of-day cutoff was getting ignored in the calendar&#8217;s Day view, but that has been corrected.</li>\n<li><strong>Fix</strong> &#8211; We have fixed a number of parameters in the <samp>the_post</samp> action for the single event view in the redesigned calendar views. This created a plugin conflict with Woody Ad Snippets that is now resolved.</li>\n<li><strong>Fix</strong> &#8211; Some folks were seeing 404 errors after updating to 5.0. We found where that was happening and patched it up.</li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/the-events-calendar-5-0-0-1/\">The Events Calendar 5.0.0.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:48:\"\n		\n		\n				\n		\n				\n\n		\n				\n								\n										\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Event Tickets Plus 4.11.1.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://theeventscalendar.com/event-tickets-plus-4-11-1-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 30 Jan 2020 16:19:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Release Notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=1990930\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:584:\"<p>Hey folks! We&#8217;re releasing a quick update for you that&#8217;s available now. Some users discovered that tickets were increasing in increments of two instead of one when adding them to an order. We fixed that up and removed duplicate scripts in the process to prevent conflicts between Tribe Commerce and WooCommerce. This is a minor&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/event-tickets-plus-4-11-1-1/\">Event Tickets Plus 4.11.1.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Courtney\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1070:\"<p>Hey folks! We&#8217;re releasing a quick update for you that&#8217;s available now. Some users discovered that tickets were increasing in increments of two instead of one when adding them to an order. We fixed that up and removed duplicate scripts in the process to prevent conflicts between Tribe Commerce and WooCommerce.</p>\n<p>This is a minor release that should be smooth sailing when updating. That said, it&#8217;s always a good idea to <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-site-backups/\">backup</a> your site and test changes in a <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">development environment</a> before installing this on your live site, as you would with any other WordPress update.</p>\n<p>Thanks everyone and enjoy the new release!</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/event-tickets-plus-4-11-1-1/\">Event Tickets Plus 4.11.1.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:35:\"https://theeventscalendar.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":