INSERT INTO `wp_postmeta` VALUES (174,55,'_form','EMPLOYMENT APPLICATION\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nLocation:\n</div>\n<div class=\"small-6 large-6 columns\">\n[radio Location \"Franklin\" \"Hoover\" \"Trussville\" \"Longview\" \"Huntsville\"]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nPosition Applying For:\n[text* PositionApplyingFor]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nDesired Pay:\n[text DesiredPay]\n</div>\n<div class=\"small-6 large-6 columns\">\nDay You Can Start:\n[text DayYouCanStart]\n</div>\n</div>\n\nPERSONAL INFORMATION\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nName:\n[text* YourName]\n</div>\n<div class=\"small-6 large-6 columns\">\nDate of Birth:\n[text* DateOfBirth]\n</div>\n</div>\n\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nStreet Address:\n[text* StreetAddress]\n</div>\n<div class=\"small-6 large-6 columns\">\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nCity:\n[text* City]\n</div>\n<div class=\"small-4 large-4 columns\">\nState:\n[text* State]\n</div>\n<div class=\"small-4 large-4 columns\">\nZip:\n[text* Zip]\n</div>\n</div>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nPrevious Address:\n[text PreviousAddress]\n</div>\n<div class=\"small-6 large-6 columns\">\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nCity:\n[text PreviousCity]\n</div>\n<div class=\"small-4 large-4 columns\">\nState:\n[text PreviousState]\n</div>\n<div class=\"small-4 large-4 columns\">\nZip:\n[text PreviousZip]\n</div>\n</div>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nTelephone Number:\n[text TelephoneNumber]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nEmail:\n[email* YourEmail]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nAvailability:\n</div>\n<div class=\"small-6 large-6 columns\">\n[radio Availability \"PartTime\" \"FullTime\"]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nPlease check the shifts you are available to work (hours may vary):\n</div>\n<div class=\"small-6 large-6 columns\">\n[checkbox Days \"Monday\" \"Tuesday\" \"Wednesday\" \"Thursday\" \"Friday\" \"Saturday\" \"Sunday\"]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nHave you ever worked for Cajun Steamer before?\n</div>\n<div class=\"small-6 large-6 columns\">\n[radio HaveYouEverWorkedForCajunSteamerBefore \"Yes\" \"No\"]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nIf yes, When?\n</div>\n<div class=\"small-6 large-6 columns\">\n[text IfYesWhen]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nFinal Position?\n</div>\n<div class=\"small-6 large-6 columns\">\n[text position]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nReason Left?\n</div>\n<div class=\"small-6 large-6 columns\">\n[text ReasonLeft]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nDo you have a Food Handler\'s Card (AL)?\n</div>\n<div class=\"small-6 large-6 columns\">\n[text FoodHandlersCard]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nDo you have an ABC License (TN)?\n</div>\n<div class=\"small-6 large-6 columns\">\n[text ABCLicense]\n</div>\n</div>\n\nWORK EXPERIENCE\n\nPlease list your previous experience beginning with your most recent position:\n\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nEmployer:\n[text Employer]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nAddress:\n[text EmployerAddress]\n</div>\n<div class=\"small-4 large-4 columns\">\nPhone Number:\n[text EmployerPhoneNumber]\n</div>\n<div class=\"small-4 large-4 columns\">\nDates Employed:\n[text DatesEmployed]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nPosition:\n[text YourPosition]\n</div>\n<div class=\"small-4 large-4 columns\">\nEnding Pay:\n[text EndingPay]\n</div>\n<div class=\"small-4 large-4 columns\">\nSupervisor:\n[text Supervisor]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nReason For Leaving:\n[text ReasonForLeaving]\n</div>\n</div>\n\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nEmployer:\n[text Employer2]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nAddress:\n[text EmployerAddress2]\n</div>\n<div class=\"small-4 large-4 columns\">\nPhone Number:\n[text EmployerPhoneNumber2]\n</div>\n<div class=\"small-4 large-4 columns\">\nDates Employed:\n[text DatesEmployed2]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nPosition:\n[text YourPosition2]\n</div>\n<div class=\"small-4 large-4 columns\">\nEnding Pay:\n[text EndingPay2]\n</div>\n<div class=\"small-4 large-4 columns\">\nSupervisor:\n[text Supervisor2]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nReason For Leaving:\n[text ReasonForLeaving2]\n</div>\n</div>\n\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nEmployer:\n[text Employer3]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nAddress:\n[text EmployerAddress3]\n</div>\n<div class=\"small-4 large-4 columns\">\nPhone Number:\n[text EmployerPhoneNumber3]\n</div>\n<div class=\"small-4 large-4 columns\">\nDates Employed:\n[text DatesEmployed3]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-4 large-4 columns\">\nPosition:\n[text YourPosition3]\n</div>\n<div class=\"small-4 large-4 columns\">\nEnding Pay:\n[text EndingPay3]\n</div>\n<div class=\"small-4 large-4 columns\">\nSupervisor:\n[text Supervisor3]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-12 large-12 columns\">\nReason For Leaving:\n[text ReasonForLeaving3]\n</div>\n</div>\n\nEDUCATION\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nHigh School:\n[text HighSchool]\n</div>\n<div class=\"small-6 large-6 columns\">\nLevel Completed:\n[text Diploma]\n</div>\n</div>\n<div class=\"row\">\n<div class=\"small-6 large-6 columns\">\nCollege:\n[text College]\n</div>\n<div class=\"small-6 large-6 columns\">\nLevelCompleted:\n[text CollegeCompleted]\n</div>\n</div>\n\nREFERRAL\n\nIf you referred to Cajun Steamer, please tell us who?\n[text Referral]\n\nELIGIBILITY\n\nAre you legally eligible for employment in the United States?\n[radio EmploymentEligibility \"Yes\" \"No\"]\n\nCRIMINAL HISTORY\n\nHave you ever been charged with a felony?\n[radio CriminalHistory \"Yes\" \"No\"]\n\nIf yes, list details & dates:\n[text CriminalDetails]\n\nConviction will not necessarily disqualify an applicant for employment.\n\nREFERENCES\nPlease list three references (not relatives):\n\nName\n[text ReferenceName1]\n\nPosition/Company\n[text ReferencePositionCompany1]\n\nCity, State\n[text ReferenceCityState]\n\nPhone Number:\n[text ReferencePhoneNumber]\n\n\n\nIMPORTANT AGREEMENT: PLEASE READ THE FOLLOWING \nIn compliance with Federal and State Equal Employment Opportunity Laws, qualified applicants are considered for all positions applied for without regard to race, color, religion, sex, national origin, age, veteran\'s status, disability, or any other legally protected status.\nINCOMPLETE APPLICATIONS WILL NOT BE CONSIDERED.\n \n \nI understand that by submitting this application, that this application and any other documents are not contracts and that, if hired, I may leave employment upon proper notice and may be terminated by the company at any time for any reason.\n\n[submit id:SUBMIT]');
