INSERT INTO `wp_posts` VALUES (5,2,'2014-05-29 04:49:56','2014-05-29 04:49:56','<h1 style=\"height: 45px;\"></h1>\n<p style=\"text-align: center;\"></p>\n<img class=\"alignnone good-times\" src=\"/wp-content/uploads/2014/05/let-the-goodtimes.png\" alt=\"let-the-goodtimes\" width=\"294\" height=\"137\">\n<div style=\"text-align: justify;\">\n\n&nbsp;\n\nThe Cajun Steamer is a New Orleans stye joint that serves killer gumbo, kicking chicken, authentic creole food, cold beer and great drinks in a lively atmosphere. If you can’t get to Nola, we\'ll bring it to you.\n\nWe are known for our wide array of Cajun classics and original creations, prepared in an authentic, made from scratch fashion. This Louisiana kitchen will get you in the mood to have a good time and have you slapping the table for more!\n\n</div>\n<div style=\"text-align: center;\"><img class=\"alignnone\" src=\"/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"lobster-icon-2\" width=\"41\" height=\"60\"></div>\n&nbsp;','Home','','publish','closed','closed','','home-page','','','2020-01-24 20:46:51','2020-01-24 20:46:51','',0,'http://cajunsteamer.wpengine.com/?page_id=5',0,'page','',0);
