INSERT INTO `wp_posts` VALUES (8,2,'2014-05-30 16:02:03','2014-05-30 16:02:03','[efstabs class=\"yourcustomclass\"]\r\n[efstab title=\"APPETIZERS\" active=\"active\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>SMOKED TUNA DIP</h5>\r\nSlow-cooked yellowfin tuna dip served with crackers\r\n<h5>FRIED DILL PICKLE CHIPS</h5>\r\nPickle chips seasoned, fried and served with a spicy ranch dip\r\n<h5>FRIED STUFFED MUSHROOMS</h5>\r\nSeafood stuffed mushrooms, battered and fried. Served with spicy ranch\r\n<h5>CRISPY FRIED CALAMARI</h5>\r\nServed with seasoned Asian sauce.\r\n<h5>CRAWFISH ENCHILADAS</h5>\r\nCreamy crawfish rolled into two flour tortillas, then topped with a rich crawfish cheese sauce\r\n<h5>BLUE CRAB CLAWS</h5>\r\nCajun, garlic herb, lemon pepper or fried. Served with cocktail sauce\r\n<h5>*SESAME SEARED TUNA</h5>\r\nTuna seared rare and served with wasabi cream, sesame-soy sauce or tiger cream sauce. Served with Caribbean slaw\r\n<h5>CRAB CAKE</h5>\r\nJumbo lump crab meat mixed with vegetables and sautéed with breadcrumbs and served with a spicy Creole mustard\r\n<h5>FIRE SHRIMP</h5>\r\nTender, crispy shrimp tossed with a creamy sauce and served over a bed of lettuce\r\n<h5>COCONUT SHRIMP</h5>\r\nLarge gulf shrimp battered and dipped in roasted coconut, fried and served with an orange marmalade dipping sauce\r\n<h5>HOG-TIED SHRIMP</h5>\r\nBacon-wrapped shrimp topped with tasso sherry cream sauce and served with grilled bread\r\n\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>STUFFED SHRIMP</h5>\r\nSucculent large shrimp with a rich crab meat stuffing and topped with Louie sauce\r\n<h5>BLUE CRAB &amp; FRIED GREEN TOMATOES</h5>\r\nFried green tomatoes topped with sautéed crab, onion, corn and remoulade\r\n<h5>BOUDIN (BOO-DAN)</h5>\r\nSeasoned pork with onions, rice and herbs. Served with spicy Creole mustard\r\n<h5>FRIED BOUDIN BALLS</h5>\r\nPork seasoned with onions, rice, and herbs then fried. Served with spicy Creole mustard\r\n<h5>GROUPER FINGERS</h5>\r\nFresh grouper strips blackened, fried, or grilled and served with cocktail sauce\r\n<h5>FRIED CRAWFISH TAILS</h5>\r\nCrawfish tail meat fried and served with cocktail sauce\r\n<h5>ALLIGATOR BITES</h5>\r\nFarm-raised alligator tail meat, blackened, fried, or grilled. Served with cocktail sauce\r\n<h5>WINGS</h5>\r\nChoose from Tiger, Buffalo, Spicy BBQ, or Tangy\r\n<div class=\"caption\">*Consuming raw or undercooked meats, poultry, seafood, shellfish, or eggs may increase your risk of food-borne illness, especially if you have certain medical conditions.</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"SOUPS &amp; SALADS\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n\r\nAll salads are served with tomatoes, cucumbers, cheddar cheese &amp; croutons.\r\n<h5>CAJUN CHEF SALAD</h5>\r\nFresh garden salad topped with fried crawfish tails and fried shrimp\r\n<h5>SHRIMP SALAD</h5>\r\nFresh garden salad with grilled or fried shrimp\r\n<h5>*SESAME SEARED TUNA SALAD</h5>\r\nFanned over a bed of baby mixed greens and drizzled with our house-made Asian vinaigrette\r\n<h5>CHICKEN SALAD</h5>\r\nFresh garden salad with sliced grilled, fried or blackened chicken\r\n<h5>HOUSE SALAD</h5>\r\nFresh garden salad with tomatoes, cucumbers, cheddar cheese, and croutons\r\n<h5>SIDE SALAD</h5>\r\nDressings:\r\nParmesan Vinaigrette, Asian Vinaigrette, Ranch, Balsamic Vinaigrette, 1000 Island, Bleu Cheese, Honey Mustard, Fat-Free Ranch, Spicy Ranch, Oil &amp; Vinegar\r\n\r\n</div>\r\n<div class=\"large-6 columns\">\r\n<h5>GUMBO YA YA</h5>\r\nIt\'s got everything ya like! Chicken &amp; sausage gumbo with shrimp, crawfish tails, oysters, and okra\r\n<h5>CHICKEN &amp; SAUSAGE GUMBO</h5>\r\n<h5>SEAFOOD GUMBO</h5>\r\n<h5>CORN AND CRAB BISQUE</h5>\r\n<h5>JAMBALAYA CUP</h5>\r\nAdd grilled bread\r\n\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"PO’ BOYS\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>CATFISH PO\' BOY</h5>\r\nFried, grilled, or blackened\r\n<h5>SHRIMP PO\' BOY</h5>\r\nFried, grilled, or blackened\r\n<h5>ALLIGATOR PO\' BOY</h5>\r\nFried, grilled, or blackened\r\n<h5>CRAWFISH PO\' BOY</h5>\r\n<h5>OYSTER PO\' BOY</h5>\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>BROKE PO\' BOY</h5>\r\nHalf of the full-size Po\' Boy, served with seasoned curly fries. Choose from:\r\nShrimp, Crawfish, Alligator, Oyster, Catfish\r\n\r\nAll Po\' Boys are served on Gambino French bread and garnished with lettuce, tomato &amp; Creole mustard with seasoned curly fries. Substitute any cup of soup or side salad.\r\n\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"SEA\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>*CAJUN BAKED SEAFOOD MEDLEY</h5>\r\nMixture of fish, shrimp, crawfish, and crab topped with Parmesan cheese, and served in a casserole dish\r\n<h5>SHRIMP &amp; GRITS</h5>\r\nSauteed jumbo shrimp served with tasso cream sauce and served over cheddar grits\r\n<h5>CRAWFISH OR SHRIMP FETTUCCINI</h5>\r\nCrawfish or shrimp with spicy cream sauce served over fettuccini. Served with grilled bread\r\n<h5>TILAPIA &amp; SHRIMP ROCKEFELLER</h5>\r\nA creamy spinach &amp; bacon sauce served over Cajun mashed potatoes\r\n<h5>*ATCHAFALAYA PIROGUE</h5>\r\nFried eggplant stuffed with grilled tilapia and topped with a crab cream sauce\r\n<h5>CRAWFISH ÉTOUFFÉE</h5>\r\nCrawfish tails mixed with a golden seasoned roux over white rice\r\n<h5>FRIED SEAFOOD PLATTER</h5>\r\nShrimp, stuffed shrimp, catfish, oysters, frog legs, and clams. Served with hushpuppies\r\n<h5>*CATFISH PONCHARTRAIN</h5>\r\nCatfish with shrimp and crab stuffing, topped with Crawfish Louie sauce\r\n<h5>SHRIMP PLATTER</h5>\r\nJumbo shrimp: 5 fried, 4 blackened or 3 stuffed. Served with fries.\r\n\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>CATFISH &amp; FRIED SHRIMP</h5>\r\nOne catfish filet fried Cajun style with fried shrimp. Served with fries. Substitute blackened or stuffed for fried\r\n<h5>SHRIMP CREOLE</h5>\r\nTraditional spicy shrimp Creole served with white rice\r\n<h5>SHRIMP DIABLO</h5>\r\nJumbo shrimp in our special tiger cream mushroom sauce served over white rice\r\n<h5>ALL SAINTS TILAPIA</h5>\r\nBlackened tilapia served with shrimp and alfredo sauce over shredded cheese, diced tomatoes, and white rice\r\n<h5>*FLOUNDER SEAFOOD ROULADE</h5>\r\nFlounder rolled with seafood stuffing, blackened, and topped with lemon butter sauce and green onions\r\n<h5>FRIED OYSTERS</h5>\r\nOne dozen fresh oysters fried in our special batter and served with fries\r\n<h5>*FISH TACOS (3)</h5>\r\nGrilled, Blackened, or Fried Tilapia topped with shredded cabbage and pico de gallo, then wrapped in a flour or corn tortilla.\r\n<h5>CRAB CAKE SANDWICH</h5>\r\nServed on a gourmet bun with remoulade, lettuce, and tomato\r\n\r\nSea items marked with an * include your choice of one side item, or substitute any cup of soup or side salad\r\n\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"LAND\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>*RED BEANS &amp; SAUSAGE</h5>\r\nA true Cajun classic for every day that ends in \"y\"\r\n<h5>COCHON &amp; GRITS</h5>\r\nCajun roasted pork butt with Creole Au Jus, corn and green onions. Served over creamy grits. Served with grilled bread\r\n<h5>BOURBON STREET FETTUCCINI</h5>\r\nChicken and smoked sausage in a creamy Creole sauce over fettuccini. Served with grilled bread\r\n<h5>VOODOO CHICKEN</h5>\r\nGrilled chicken with a creamy reduction of white wine, caramelized onions, bacon, and crawfish with our sweet balsamic glaze. Served over white rice\r\n<h5>*BAYOU CHICKEN</h5>\r\nShrimp and crab-stuffed chicken with our Crawfish Louie sauce\r\n\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>*CARIBBEAN JERK CHICKEN</h5>\r\nGlazed jerk chicken skewers with Caribbean mango sauce. Served over steamed rice\r\n<h5>MELVIN\'S BLACKENED CHICKEN</h5>\r\nCajun blackened chicken, caramelized onions, and bacon with our sweet balsamic glaze and served over Cajun mashed potatoes\r\n<h5>GRILLED, BLACKENED, OR LEMON PEPPER CHICKEN</h5>\r\nServed on a bed of rice with asparagus\r\n<h5>CAJUN TRIO</h5>\r\nAny three sides or substitute soup\r\n<h5>*FLAT IRON STEAK &amp; SHRIMP</h5>\r\nA 6 oz. steak grilled to your temperature alongside five fantail grilled shrimp and served with sautéed red potatoes\r\n<div class=\"caption\">Land items served with your choice of one side item if marked with an * or Substitute any cup of soup or side salad</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"GRILLED &amp; STEAMED SEAFOOD\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>*RAW OYSTERS  (NO TO GO ORDERS)</h5>\r\nMarket Fresh on the half-shell and served on a bed of rice\r\n<h5>*CHAR-GRILLED OYSTERS</h5>\r\nTopped with garlic herb seasoning, melted butter, and Parmesan cheese\r\n<h5>*OYSTERS ROCKEFELLER</h5>\r\nOysters topped with spinach, bacon, and Parmesan cheese\r\n<h5>HOT BOILED CRAWFISH (SEASONAL)</h5>\r\n<h5>ROYAL RED SHRIMP</h5>\r\nHead-on, sweet, deepwater shrimp. Served with corn and potatoes\r\n<h5>**THE TALLULAH PLATTER</h5>\r\nA large platter of Royal Red shrimp &amp; hot boiled crawfish. Served with corn and potatoes\r\n\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>SNOW CRAB LEGS (2 CLUSTERS)</h5>\r\nServed with corn and potatoes\r\n<h5>PEEL &amp; EAT SHRIMP</h5>\r\nShrimp boiled in Cajun Steamer\'s special seasoning. Served hot or cold with corn and potatoes\r\n<h5>**STEAMED SEAFOOD PLATTER FOR TWO</h5>\r\nRoyal Red Shrimp, one crab cluster, oysters and hot boiled crawfish. Served with corn and potatoes\r\n<h5>PRINCE EDWARD ISLAND MUSSELS</h5>\r\nMussels steamed in a rich, delicious broth. Served with grilled French bread.\r\n<div class=\"caption\">*Consuming raw or undercooked meats, poultry, seafood, shellfish, or eggs may increase your risk of food-borne illness, especially if you have certain medical conditions.\r\n**Mussels will be substituted when crawfish are not in season.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"SIDES\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>SAUTÉED VEGETABLE MEDLEY</h5>\r\n<h5>HUSHPUPPIES</h5>\r\n<h5>RED BEANS &amp; SAUSAGE</h5>\r\n<h5>FRIED GREEN TOMATOES</h5>\r\n<h5>CAJUN MASHED POTATOES</h5>\r\n<h5>CHEDDAR CHEESE GRITS</h5>\r\n<h5>BLACK-EYED PEAS</h5>\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>DIRTY RICE</h5>\r\n<h5>FRIED OKRA</h5>\r\n<h5>GRILLED ASPARAGUS</h5>\r\n<h5>CRAWFISH ÉTOUFFÉE</h5>\r\n<h5>CORN &amp; POTATOES</h5>\r\n<h5>CHICKEN &amp; SAUSAGE JAMBALAYA</h5>\r\n<h5>SEASONED CURLY FRIES</h5>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[efstab title=\"DESSERTS\"]\r\n<div class=\"row\">\r\n<div class=\"large-6 columns tex-center menu-border\">\r\n<h5>ACADIAN BREAD PUDDING</h5>\r\nServed with bourbon caramel sauce\r\n<h5>BEIGNETS</h5>\r\nFried beignets from the French Quarter dusted with powdered sugar\r\n<h5>CHOCOLATE DECADENCE CAKE</h5>\r\nServed with vanilla ice cream\r\n<h5>CHEESECAKE</h5>\r\nTopped with strawberry sauce\r\n\r\n</div>\r\n<div class=\"large-6 columns tex-center\">\r\n<h5>FRIED CHEESECAKE</h5>\r\nServed with bourbon caramel sauce\r\n<h5>KEY LIME PIE</h5>\r\nTopped with whipped cream\r\n<h5>CAJUN CUSTARD PIE</h5>\r\nOur own rich cream custard pie\r\n\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n[efstab title=\"COCKTAILS\" id=\"cocktails\" active=\"cocktails\"]\r\n<div class=\"row\">\r\n<div class=\"medium-6 columns tex-center menu-border\">\r\n<h5>FROZEN MARGARITA</h5>\r\nGrand Marnier, tequilla, and margarita mix\r\n<h5>HURRICANE</h5>\r\nMyers\'s rum, orange juice, and Pat O’Brien’s hurricane mix\r\n<h5>VOODOO SUNRISE</h5>\r\nVodka, rum, orange juice, and grenadine\r\n<h5>BEACH MARTINI</h5>\r\nVodka, Malibu, orange juice, pineapple juice, and grenadine\r\n<h5>BOURBON ST. BLOODY MARY</h5>\r\nBelvedere Bloody Mary vodka and Zing Zang garnished with Tony Chachere’s spicy green beans, pickled okra, and olives\r\n<h5>DOWNHOUMA PUNCH</h5>\r\nGrand Marnier, orange juice,  orange slice, and sugared rum\r\n<h5>BAYOU BREEZE</h5>\r\nGrand Marnier, orange and pineapple juice, served with a sugared rim and orange slice\r\n<h5>THE BIG EASY</h5>\r\nMalibu and light rum, triple sec and banana schnapps, orange and pineapple juice, a splash of grenadine and topped with Myers\'s Rum\r\n\r\n</div>\r\n<div class=\"medium-6 columns tex-center\">\r\n<h5>STEAMER’S RED BULL VODKA</h5>\r\nVodka served with a can of Red Bull or Sugar Free Red Bull\r\n<h5>PEACH MARTINI</h5>\r\nSmirnoff vodka, Monin peach syrup, Triple Sec, and cranberry juice.\r\n<h5>BLACKENED GINGER</h5>\r\nCaptain Morgan Black Spiced Rum and ginger ale\r\n<h5>DELTA DEW DROP</h5>\r\nHendrick’s Gin, Monin cucumber and blueberry syrup and Sprite\r\n<h5>ANTIOXIDANT COCKTAIL</h5>\r\nAbsolut acai berry vodka, Pama Liquor, and fresh lemon juice\r\n<h5>PEACH SPRITZER</h5>\r\nChardonnay, Monin peach syrup, peach Schnapps, soda water\r\n<h5>PEACHBERRY MARTINI</h5>\r\nPinnacle whipped vodka, Monin peach and blueberry syrup, cranberry juice, soda, and cream\r\n\r\nDrinks vary per location.\r\n\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"medium-12 columns text-center lobster\"><img src=\"http://cajunsteamer.wpengine.com/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n[/efstab]\r\n\r\n[/efstabs]','Menu','','publish','closed','closed','','menu','','','2015-04-27 22:36:04','2015-04-27 22:36:04','',0,'http://cajunsteamer.wpengine.com/?page_id=8',0,'page','',0);
