INSERT INTO `wp_posts` VALUES (10,2,'2014-05-30 16:04:12','2014-05-30 16:04:12','<p style=\"text-align: center;\"><em>You can reach our catering specialist at <b>catering@cajunsteamer.com</b> or 844-TO-GEAUX. Thank you for considering the Cajun Steamer for your next event. We look forward to exceeding all of your expectations.</em></p>\n<a href=\"http://cajunsteamer.local/wp-content/uploads/2019/09/CATERING-MENU-2019.pdf\">DOWNLOAD CATERING MENU</a>\n<div class=\"medium-6 columns\"></div>\n<div class=\"large-12 columns text-center lobster\"><img src=\"/wp-content/uploads/2014/05/lobster-icon-2.png\" alt=\"\" /></div>','Catering','','publish','closed','closed','','catering','','','2019-09-19 15:35:01','2019-09-19 15:35:01','',0,'http://cajunsteamer.wpengine.com/?page_id=10',0,'page','',0);
INSERT INTO `wp_posts` VALUES (11,2,'2014-05-30 16:04:21','2014-05-30 16:04:21','<p>Thank you for inquiring about being part of the the family. We are always accepting applications of outgoing, highly motivated individuals. If you have a true love of food, hospitality and take pride in your work, please email or fill out the online application here.</p>\r\n<h4 style=\"text-align: center;\">Please choose the location you wish to apply to.</h4>\r\n<p style=\"text-align: center;\"><a class=\"button\" href=\"http://cajunsteamer.local/join/hoover/\">Hoover, AL</a>\r\n<a class=\"button\" href=\"http://cajunsteamer.local/join/trussville/\">Trussville, AL</a>\r\n<a class=\"button\" href=\"http://cajunsteamer.local/join/franklin/\">Franklin, TN</a>\r\n<a class=\"button\" href=\"http://cajunsteamer.local/join/huntsville/\">Huntsville, AL</a></p>','Careers','','draft','closed','closed','','join','','','2018-07-09 19:19:50','2018-07-09 19:19:50','',0,'http://cajunsteamer.wpengine.com/?page_id=11',0,'page','',0);
