INSERT INTO `wp_posts` VALUES (214,9,'2016-01-28 14:59:14','2016-01-28 14:59:14','EMPLOYMENT APPLICATION\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-12 large-12 columns\">\r\nPosition Applying For:\r\n[text* PositionApplyingFor]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nDesired Pay:\r\n[text DesiredPay]\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\nDay You Can Start:\r\n[text DayYouCanStart]\r\n</div>\r\n</div>\r\n\r\nPERSONAL INFORMATION\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nName:\r\n[text* YourName]\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\nDate of Birth:\r\n[text* DateOfBirth]\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nStreet Address:\r\n[text* StreetAddress]\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n<div class=\"row\">\r\n<div class=\"small-4 large-4 columns\">\r\nCity:\r\n[text* City]\r\n</div>\r\n<div class=\"small-4 large-4 columns\">\r\nState:\r\n[text* State]\r\n</div>\r\n<div class=\"small-4 large-4 columns\">\r\nZip:\r\n[text* Zip]\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nPrevious Address:\r\n[text PreviousAddress]\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n<div class=\"row\">\r\n<div class=\"small-4 large-4 columns\">\r\nCity:\r\n[text PreviousCity]\r\n</div>\r\n<div class=\"small-4 large-4 columns\">\r\nState:\r\n[text PreviousState]\r\n</div>\r\n<div class=\"small-4 large-4 columns\">\r\nZip:\r\n[text PreviousZip]\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-12 large-12 columns\">\r\nTelephone Number:\r\n[text TelephoneNumber]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-12 large-12 columns\">\r\nEmail:\r\n[email* YourEmail]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nAvailability:\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[radio Availability \"PartTime\" \"FullTime\"]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nPlease check the shifts you are available to work (hours may vary):\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[checkbox Days \"Monday\" \"Tuesday\" \"Wednesday\" \"Thursday\" \"Friday\" \"Saturday\" \"Sunday\"]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nHave you ever worked for Cajun Steamer before?\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[radio HaveYouEverWorkedForCajunSteamerBefore \"Yes\" \"No\"]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nIf yes, When?\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[text IfYesWhen]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nFinal Position?\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[text position]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nReason Left?\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[text ReasonLeft]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nDo you have a Food Handler\'s Card (AL)?\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[text FoodHandlersCard]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-6 large-6 columns\">\r\nDo you have an ABC License (TN)?\r\n</div>\r\n<div class=\"small-6 large-6 columns\">\r\n[text ABCLicense]\r\n</div>\r\n</div>\r\n\r\nWORK EXPERIENCE\r\n\r\nPlease list your previous experience beginning with your most recent position:\r\n\r\n<div class=\"row\">\r\n<div class=\"small-12 large-12 columns\">\r\nEmployer:\r\n[text Employer]\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"small-4 large-4 columns\">\r\nAddress:\r