igin, age, veteran\'s status, disability, or any other legally protected status.\r\nINCOMPLETE APPLICATIONS WILL NOT BE CONSIDERED.\r\n \r\n \r\nI understand that by submitting this application, that this application and any other documents are not contracts and that, if hired, I may leave employment upon proper notice and may be terminated by the company at any time for any reason.\r\n\r\n[submit id:SUBMIT]\nEmployment Application: JOIN THE CAJUN STEAMER TEAM!\n[name] <[email]>\nFrom: [name] [email]\r\nJOIN THE CAJUN STEAMER TEAM!\r\n\r\nMessage Body:\r\n\r\nLocation: [Location]\r\n\r\nPosition Applying For: [PositionApplyingFor]\r\n\r\nDesired Pay: [DesiredPay]\r\n\r\nDay You Can Start: [DayYouCanStart]\r\n\r\nName: [name]\r\n\r\nDate Of Birth: [DateOfBirth]\r\n\r\nStreet Address: \r\n[StreetAddress]\r\n[City], [State] [Zip]\r\n\r\nPrevious Address: \r\n[PreviousAddress]\r\n[PreviousCity], [PreviousState] [PreviousZip]\r\n\r\nTelephone Number: [TelephoneNumber]\r\n\r\nAvailability: [Availability \"PartTime\" \"FullTime\"]\r\n\r\nDays: [Days]\r\n\r\nHave You Ever Worked For Cajun Steamer Before: [HaveYouEverWorkedForCajunSteamerBefore]\r\n\r\nIf Yes When: [IfYesWhen]\r\n\r\nPosition: [position]\r\n\r\nReason Left: [ReasonLeft]\r\n\r\nFood Handlers Card: [FoodHandlersCard]\r\n\r\nABC License: [ABCLicense]\r\n\r\nEmployer: [Employer]\r\n\r\nEmployer Address: [EmployerAddress]\r\n\r\nEmployer Phone Number: [EmployerPhoneNumber]\r\n\r\nDates Employed: [DatesEmployed]\r\n\r\nYour Position: [YourPosition]\r\n\r\nEndingPay: [EndingPay]\r\n\r\nSupervisor: [Supervisor]\r\n\r\nReason For Leaving: [ReasonForLeaving]\r\n\r\nEmployer2: [Employer2]\r\n\r\nEmployerAddress2: [EmployerAddress2]\r\n\r\nEmployer Phone Number 2: [EmployerPhoneNumber2]\r\n\r\nDates Employed 2: [DatesEmployed2]\r\n\r\nYour Position 2: [YourPosition2]\r\n\r\nEnding Pay 2: [EndingPay2]\r\n\r\nSupervisor 2: [Supervisor2]\r\n\r\nReason For Leaving 2: [ReasonForLeaving2]\r\n\r\nEmployer 3: [Employer3]\r\n\r\