INSERT INTO `wp_posts` VALUES (1369,9,'2017-07-13 13:50:05','2017-07-13 13:50:05','<div class=\"text-center\" style=\"max-width: 930px; margin: 0 auto;\">\r\n<p>The Cajun Steamer is a funky joint born out of a true love for the city of New Orleans and South Louisiana’s food, people and fun-loving approach to life.  Food and drink are meant to be a celebration - every meal is just a reason to gather together with friends, family and those that will be.  Our place is your place…where all are welcome.  The restaurant is a reflection of the people who work in it and those we are lucky enough to serve.  Swing in to have a drink & bite with us anytime. Cheers!</p>\r\n</div>','About Us','','publish','closed','closed','','about-us','','','2017-07-13 19:27:19','2017-07-13 19:27:19','',0,'http://cajunsteamer.local/?page_id=1369',0,'page','',0);
