INSERT INTO `wp_posts` VALUES (1485,9,'2017-11-08 16:39:09','2017-11-08 16:39:09','<b>Friday, 11/10/17</b>\r\n\r\nAs a “thank you” to the nation’s heroic military personnel Cajun Steamer is inviting Veterans and active-duty U.S. Military members to enjoy an entrée on the house for Veteran’s Day.  At all Cajun Steamer locations, guests with a valid military ID will receive a complimentary entrée up to $14 in value which includes Cajun &amp; Creole favorites like Voodoo Chicken, Crawfish Etouffee, and Bourbon Street Fettuccini.  The Cajun Steamer Veteran’s Day deal requires the purchase of a drink and will take place <em>Friday, November 10, from </em><span data-term=\"goog_809700555\">11am<em> to </em>10pm.</span>  More details can be found by contacting the restaurant directly.','FREE MEAL FOR MILITARY PERSONNEL','','publish','closed','closed','','free-military-meal','','','2017-11-08 16:40:38','2017-11-08 16:40:38','',0,'http://cajunsteamer.local/?page_id=1485',0,'page','',0);
